public class Solution {
    public long BeautifulSubstrings(string s, int k) {
        long count = 0;
        int[] vowelCounts = new int[s.Length + 1];
        int[] consonantCounts = new int[s.Length + 1];

        for (int i = 0; i < s.Length; i++) {
            vowelCounts[i + 1] = vowelCounts[i] + (IsVowel(s[i]) ? 1 : 0);
            consonantCounts[i + 1] = consonantCounts[i] + (IsVowel(s[i]) ? 0 : 1);
        }

        for (int start = 0; start < s.Length; start++) {
            for (int end = start + 1; end <= s.Length; end++) {
                int vowels = vowelCounts[end] - vowelCounts[start];
                int consonants = consonantCounts[end] - consonantCounts[start];
                if (vowels == consonants && (vowels * consonants) % k == 0) {
                    count++;
                }
            }
        }

        return count;
    }

    private bool IsVowel(char c) {
        return "aeiou".Contains(c);
    }
}
